<html lang="en">
<head>
<meta charset="UTF-8">
<meta name="viewport" content="width=device-width, initial-scale=1.0, maximum-scale=1.0, user-scalable=no">
<title>Mid-Term Rental Research</title>
<style>
  * { box-sizing: border-box; margin: 0; padding: 0; }
  body {
    font-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, sans-serif;
    background: #fafbfc;
    color: #1a1a2e;
    min-height: 100vh;
    display: flex;
    align-items: center;
    justify-content: center;
  }
  .lock-screen { width: 100%; max-width: 400px; padding: 24px; text-align: center; }
  .lock-icon { font-size: 48px; margin-bottom: 16px; }
  .lock-title { font-size: 20px; font-weight: 700; margin-bottom: 8px; }
  .lock-subtitle { font-size: 14px; color: #64748b; margin-bottom: 24px; }
  .pw-input { width: 100%; padding: 14px 16px; border: 2px solid #e8ecf1; border-radius: 12px; font-size: 16px; text-align: center; outline: none; transition: border-color 0.2s; -webkit-appearance: none; }
  .pw-input:focus { border-color: #2563eb; }
  .pw-input.error { border-color: #dc2626; animation: shake 0.4s; }
  @keyframes shake { 0%,100%{transform:translateX(0)} 25%{transform:translateX(-8px)} 75%{transform:translateX(8px)} }
  .unlock-btn { width: 100%; padding: 14px; background: linear-gradient(135deg, #1e3a5f 0%, #2563eb 100%); color: white; border: none; border-radius: 12px; font-size: 16px; font-weight: 600; cursor: pointer; margin-top: 12px; transition: opacity 0.2s; }
  .unlock-btn:hover { opacity: 0.9; }
  .unlock-btn:disabled { opacity: 0.5; cursor: not-allowed; }
  .error-msg { color: #dc2626; font-size: 13px; margin-top: 10px; min-height: 20px; }
  .spinner { display:inline-block; width:18px; height:18px; border:2px solid rgba(255,255,255,0.3); border-top-color:white; border-radius:50%; animation:spin 0.6s linear infinite; vertical-align:middle; margin-right:6px; }
  @keyframes spin { to{transform:rotate(360deg)} }
</style>
</head>

    onkeydown="if(event.key==='Enter')unlock()">
  <button class="unlock-btn" id="btn" onclick="unlock()">Unlock</button>
  <div class="error-msg" id="err"></div>
</div>

function b(s){const d=atob(s);const a=new Uint8Array(d.length);for(let i=0;i<d.length;i++)a[i]=d.charCodeAt(i);return a;}
async function dk(p,s){const e=new TextEncoder();const k=await crypto.subtle.importKey("raw",e.encode(p),"PBKDF2",false,["deriveKey"]);return crypto.subtle.deriveKey({name:"PBKDF2",salt:s,iterations:100000,hash:"SHA-256"},k,{name:"AES-CBC",length:256},false,["decrypt"]);}
async function unlock(){

  const btn=document.getElementById("btn");
  const err=document.getElementById("err");
  const input=document.getElementById("pw");
  if(!pw){err.textContent="Please enter a password";return;}
  btn.disabled=true;btn.innerHTML='<span class="spinner"></span>Decrypting...';err.textContent="";input.classList.remove("error");
  try{
    const key=await dk(pw,b(S));
    const dec=await crypto.subtle.decrypt({name:"AES-CBC",iv:b(I)},key,b(C));
    const d=new Uint8Array(dec);const pl=d[d.length-1];const u=d.slice(0,d.length-pl);

    if(!html.includes("<!DOCTYPE")&&!html.includes("<html")){throw new Error("Invalid");}
    document.open();document.write(html);document.close();
  }catch(e){
